/**
 * When using variants, children animations will start after this duration (in seconds). You can add the `transition` property to both the `Frame` and the `variant` directly. Adding it to the `variant` generally offers more flexibility, as it allows you to customize the delay per visual state.
 *
 * @library
 * ```jsx
 * const container = {
 *   hidden: { opacity: 0 },
 *   show: {
 *     opacity: 1,
 *     transition: {
 *       delayChildren: 0.5
 *     }
 *   }
 * }
 *
 * const item = {
 *   hidden: { opacity: 0 },
 *   show: { opacity: 1 }
 * }
 *
 * return (
 *   <Frame
 *     variants={container}
 *     initial="hidden"
 *     animate="show"
 *   >
 *     <Frame variants={item} size={50} />
 *     <Frame variants={item} size={50} />
 *   </Frame>
 * )
 * ```
 *
 * @motion
 * ```jsx
 * const container = {
 *   hidden: { opacity: 0 },
 *   show: {
 *     opacity: 1,
 *     transition: {
 *       delayChildren: 0.5
 *     }
 *   }
 * }
 *
 * const item = {
 *   hidden: { opacity: 0 },
 *   show: { opacity: 1 }
 * }
 *
 * return (
 *   <motion.ul
 *     variants={container}
 *     initial="hidden"
 *     animate="show"
 *   >
 *     <motion.li variants={item} />
 *     <motion.li variants={item} />
 *   </motion.ul>
 * )
 * ```
 *
 * @public
 */

/**
 * When using variants, animations of child components can be staggered by this duration (in seconds).
 *
 * For instance, if `staggerChildren` is `0.01`, the first child will be delayed by `0` seconds, the second by `0.01`, the third by `0.02` and so on.
 *
 * The calculated stagger delay will be added to `delayChildren`.
 *
 * @library
 * ```jsx
 * const container = {
 *   hidden: { opacity: 0 },
 *   show: {
 *     opacity: 1,
 *     transition: {
 *       staggerChildren: 0.5
 *     }
 *   }
 * }
 *
 * const item = {
 *   hidden: { opacity: 0 },
 *   show: { opacity: 1 }
 * }
 *
 * return (
 *   <Frame
 *     variants={container}
 *     initial="hidden"
 *     animate="show"
 *   >
 *     <Frame variants={item} size={50} />
 *     <Frame variants={item} size={50} />
 *   </Frame>
 * )
 * ```
 *
 * @motion
 * ```jsx
 * const container = {
 *   hidden: { opacity: 0 },
 *   show: {
 *     opacity: 1,
 *     transition: {
 *       staggerChildren: 0.5
 *     }
 *   }
 * }
 *
 * const item = {
 *   hidden: { opacity: 0 },
 *   show: { opacity: 1 }
 * }
 *
 * return (
 *   <motion.ol
 *     variants={container}
 *     initial="hidden"
 *     animate="show"
 *   >
 *     <motion.li variants={item} />
 *     <motion.li variants={item} />
 *   </motion.ol>
 * )
 * ```
 *
 * @public
 */

/**
 * The direction in which to stagger children.
 *
 * A value of `1` staggers from the first to the last while `-1` staggers from the last to the first.
 *
 * @library
 * ```jsx
 * const container = {
 *   hidden: { opacity: 0 },
 *   show: {
 *     opacity: 1,
 *     transition: {
 *       delayChildren: 0.5,
 *       staggerDirection: -1
 *     }
 *   }
 * }
 *
 * const item = {
 *   hidden: { opacity: 0 },
 *   show: { opacity: 1 }
 * }
 *
 * return (
 *   <Frame
 *     variants={container}
 *     initial="hidden"
 *     animate="show"
 *   >
 *     <Frame variants={item} size={50} />
 *     <Frame variants={item} size={50} />
 *   </Frame>
 * )
